import React, { Component } from "react";
import './recentactions.css';

class RecentActions extends Component {
    render(){
        return(
            <>
                <div className="recentActionsBox">
                    <table className="recentActionsTable">
                        <tr>
                            <th className="recentActionCol1">Recent Action</th>
                            <th className="recentActionCol2">Purchase/Sale</th>
                            <th className="recentActionCol3">Date Completed</th>
                            <th className="recentActionCol4">Follow-up action</th>
                        </tr>
                        <tr>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td></td>
                        </tr>
                    </table>
                </div>
            </>
        )
    }
}

export default RecentActions;
